import React from "react";
import "../UserProfileRecipesListStyle.css";
import moment from "moment";
import { faEdit, faTrash } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const UserProfileListRecipes = ({
  recipes,
  toggleEditModal,
  toggleDeleteModal,
}) => {
  return (
    <>
      <h2 className="user_profile_list_title">Моите рецепти</h2>

      <table className="task">
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
            <th>Date</th>
            <th style={{ width: 250 }}>Options</th>
          </tr>
        </thead>
        <tbody>
          {recipes.map((recipe, index) => {
            return (
              <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                <td> {recipe.id}</td>
                <td>
                  <img src={recipe.image} alt="task" />
                  {recipe.title}
                </td>
                <td>
                  {recipe.Date === null
                    ? ""
                    : moment.unix(recipe.Date).format("DD.MM.YYYY")}
                </td>
                <td>
                  <FontAwesomeIcon
                    className="delete"
                    onClick={() => toggleDeleteModal(recipe.id)}
                    icon={faTrash}
                  />
                  <FontAwesomeIcon
                    className="edit"
                    onClick={() => toggleEditModal(recipe.id)}
                    icon={faEdit}
                  />
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default UserProfileListRecipes;
